import React from "react";
import './categories.style.scss';
import { useParams } from "react-router-dom";

const CategoryPage = () => {
    let params = useParams();
    console.log("params", params);
    return (
        <div className="category">
            <h2>Categories</h2>
        </div>
    )
}
export default CategoryPage;
